INSERT INTO `92mm-lüfter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/92mm-Lüfter/AABCOOLING Super Silent.webp;', 'AABCOOLING Super Silent', 'https://www.amazon.de/AAB-Cooling-Super-Silent-Anti-Vibration-Pads/dp/B01HTO63PK/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3GG4Z1RIUBPCE&keywords=AABCOOLING+Super+Silent&qid=1667045801&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=%2Caps%2C65&sr=8-1', '6,99', 4.6, 176, 0, '-;AAB Cooling;77.1 g;-;13 dB;AABCOOLING;Desktop;Luft;Kunststoff;1600 Umdrehungen pro Minute;12 Volt (Gleichstrom);3-polig;✅ The 80mm fan operates at a constant speed of 1600 ± 10%. This allows for significant increase in efficiency.|✅ The airflow is up to 170 m³ / h and the noise generated by the 12V DC fan propeller is 13,9 dB, which makes it a very quiet and efficient fan in its class available on the market.|✅ Highly efficient and quiet fan operation and 120x120x25 mm dimensions allow the fan to be mounted on the heatsink for efficient cooling of the processor instead of the loud noise of other fans from different manufacturers.|✅ The airflow fan mounting is very simple - the fan is mounted on 4 screws, attached just like the standard, allows quick and easy replacement of the loud fan.|✅ The modern FDB (Fluid Dynamic Bearing) with oil fill ensures quiet computer fan operation and extended lifespan up to 100,000 h.');
INSERT INTO `92mm-lüfter` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/92mm-Lüfter/Alphacool 24814 Eiszyklon Aurora.webp;', 'Alphacool 24814 Eiszyklon Aurora', 'https://www.amazon.de/Alphacool-Eiszyklon-Aurora-Digital-120x120x25mm/dp/B0813W6R5X/ref=sr_1_1?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=MRSTF2HIUSSM&keywords=Alphacool+24814+Eiszyklon+Aurora&qid=1667045808&sprefix=alphacool+24814+eis%2Caps%2C79&sr=8-1', '18,90', 4.7, 15, 0, '-;Alphacool;150 g;Nein;33.8 dB;Alphacool;Desktop;Wasser;-;-;5 Volt;3-polig;Der Alphacool Eiszyklon Aurora LUX Pro 2 Lüfter wird auch auf der Alphacool Eisbaer Aurora Reihe verwendet und bietet neben einem weiten Regelbereich auch eine überragende Digitale RGB LED Beleuchtung an. Die einzeln steuerbaren 5V aRGB LEDs gepaart mit dem speziellen Design des Lüfterrah-mens erzeugen einzigartige Effekte.|Geniale Beleuchtung Im Rahmen sind Digital adressierbaren 5V RGB LEDs verbaut die den gesamten Rahmen auf beiden Seiten ausleuchten. Dabei ist der Rahmen nicht durchgehend transparent sondern die Beleuchtung erfolgt durch schmale Schlitze die an vier Stellen unterbrochen sind. Auf der Oberseite sind zwei Reihen dieser Schlitzförmigen Aussparungen zu finden. Jeweils ein schmaler Rahmen verläuft einmal innen und einmal außen am Rahmen entlang.|Weiter Regelbereich und Silent Über den 4-Pin PWM Anschluss kann der Lüfter von 700 bis 2000 rpm geregelt werden. Bei 700 rpm ist der Lüfter nahezu lautlos, bietet aber dennoch einen guten Luftdruchsatz gepaart mit einem hohen statischen Druck. Dadurch kann der Lüfter auch sehr gut auf Radiatoren einer Wasserkühlung eingesetzt werden. Dank des hohen Luftstromes eignet sich der Lüfter aber auch hervorragend für die Belüftung eines Gehäuses. Direkt am Rahmen sind zudem Entkoppler zu finden.|Anschlüsse? Der Lüfter wird über einen 4-Pin PWM Anschluss gesteuert. Das Kabel ist 50 cm lang. Damit kann man den Lüfter auch ohne weitere Adapterkabel oder Verlängerungen an das Mainboard oder einem speziellen Controller anschließen. Die Digitale aRGB LED Beleuchtung wird über einen JST 3-Pin Stecker angesteuert.|Technische Daten L x B x H: 120 x 120 x 25mm Drehzahl: 700 - 2000 rpm Statischer Druck: 2,0 mm H2O Luftdurchsatz: 104,49 m³/h Lager: Hydraulisch Lüfteranschluss: 4-Pin PWM aRGB Anschluss: 3-Pin JST + 3-Pin 5V LEDs: Adressierbare Digital RGB LEDs Lautstärke: 21,5 - 33,8 dB(A) MTBF: 40.000h');
